    #         pixel = pixel_data[row][col]
    #         if pixel == ".":
    #             print("& \\bk0 ", end="")
    #         elif pixel == "B":
    #             print("& \\bl0 ", end="")
    #         elif pixel == "O":
    #             print("& \\bo0 ", end="")
    #         elif pixel == "W":
    #             print("& \\bw0 ", end="")
    #         elif pixel == "G":
    #             print("& \\bg0 ", end="")
    #         elif pixel == "V":
    #             print("& \\bv0 ", end="")
    #     print("\\\\")
    # print("\\end{tabular}")
    # print("}")
